import styles from "../styles/Cbc.module.css"
import cbc from "../assets/cbc.gif";
import cbcplayerguide from "../assets/cbcplayerguides.jpg"
import cbcplayerdesign from "../assets/cbcplayerdesign.jpg"

function Cbc() {
    return (
        <section className={styles.cbc}>
            <h1>CBC Video Player</h1>
            <h3>Canada Broadcasting Company</h3>
            <p>
                The Canadian Broadcasting Corporation is a broadcasting network in Canada. They offer programming and news throughout the country. Their mission is to inform, to reveal, to contribute to the understanding of issues of public interest.</p>
            <p>
                As a User Experience Designer at CBC, I had the opportunity to design a new CBC Player homepage. I collaborated with stakeholders from various departments across CBC in television, radio, news and sports. From there, a design was created that can adapt to the various content within CBC.
            </p>
            <img src={cbc} className={styles.cbcImg} alt="OANDA metrics" />
            <img src={cbcplayer} className={styles.cbcImg} alt="OANDA metrics" />
        </section>
    );
}

export default Cbc;
